import React from "react";
import { View, Image, StyleSheet } from "@react-pdf/renderer";

import "./index.css"

export function HeaderLogo({ headerLogo }) {

    return (
        <View style={[styles.container, headerLogo.style]}>
            {headerLogo.logo === '' ?
                <View style={styles.img} />
                :
                <Image style={styles.img} src={headerLogo.logo} />
            }

        </View>

    )
}

export function HeaderLogo2({ headerLogo }) {

    return (
        <div className="HeaderLogoContainer" style={headerLogo.style}>
            {headerLogo.logo === '' ?
                <div className="headerBackground"> </div>
                :
                <img className="headerBackground" src={headerLogo.logo} />
            }
        </div>
    )

}

const styles = StyleSheet.create({
    container: {
        width: '100%',
        flexDirection: 'row',
        height: 80,
        alignItems: 'center',
        paddingHorizontal: 40
    },
    img: {
        width: 'auto',
        height: 50
    }

})
